import React from "react";


class ClassComponents extends React.Component{

    constructor(){
        super()
        this.state={
            data:[
                {name:'John Doe',
            age:45},
            {name:'Peter parkour',
        age:43},
            {name:'Ethen Hunt',
        age:45}
            ]
        }
    }
    render(){
        return <div>
            <Studentname/>
            {this.state.data.map((item)=><Link data={item}/>)}
        </div>
    }
 }  
 class Studentname extends React.Component{
    render(){
        return <h1>Student name Details</h1>
    }
 }
class Link extends React.Component{
    render(){
        return <div>
            <ul>
                <li>
                    {this.props.data.name}
                    <li>
                    {this.props.data.age}
                    </li>

                </li>
            </ul>
        </div>
    }
}

export default ClassComponents


